import React, { useState, useEffect } from "react";
import { Button, Cards, Text } from "../atomes";

const produitVinRouge = require("../../assets/produitVinRouge.png");
const produitVinBlanc = require("../../assets/produitVinBlanc.png");
const produitChampagne = require("../../assets/produitChampagne.png");

const News = () => {
  const [produits, setProduits] = useState([]);

  const fetchProduits = async () => {
    try {
      const values = await client.get("http://localhost:8000/products");
      if (values) {
        const token = res.data;
        setProfile(token);
        storeData(token);
        setIsLoggedIn(true);
        setUserInfo({ email: "", plainPassword: "" });
        console.log("Création utilisateur validé :", token);
      } else {
        console.log("registerUser failed");
        setErrorLogin(true);
      }
      formikActions.setSubmitting(false);
    } catch (error) {
      console.log("Erreur registerUser :", error.message);
    }
  };

  useEffect(() => {
    fetchProduits();
  }, []);

  return (
    <div className="px-28 mt-20">
      <div className="flex flex-row items-center mb-8">
        <div>
          <Text.h4>Nouveautés</Text.h4>
        </div>
        <div className="w-full h-[2px] bg-gray-300 mx-6"></div>
      </div>
      <div className="flex flex-row mb-6">
        <Cards.Produit
          bg={produitVinRouge}
          color={"#5C221E"}
          typeColor={"#5C221E"}
          type={"Rouge"}
          name={"Vin Rouge Corvo"}
          pays={"Italie"}
          oldPrice={"16.80€"}
          price={"13.80€"}
        />
        <Cards.Produit
          bg={produitVinBlanc}
          color={"#FFECB3"}
          typeColor={"#FFECB3"}
          type={"Blanc"}
          name={"Vin BlancGrigio"}
          pays={"Italie"}
          oldPrice={"29.99€"}
          price={"24.99€"}
        />
        <Cards.Produit
          bg={produitChampagne}
          color={"#D0943A"}
          typeColor={"#D0943A"}
          type={"Champagne"}
          name={"Champagne Pinot"}
          pays={"France"}
          oldPrice={"29.90€"}
          price={"27.90€"}
        />
      </div>
    </div>
  );
};

export { News };
